issue.body:
I am using moment.js with my node.js project

```
isWithinTime: function(end) {

     var moment = require('moment');
     var now = moment(new Date()).format('HH:mm');
     var end = moment(new Date(end)).format('HH:mm');

     if (now.toString() > end.toString()) {
         return false;
     }
     return true;
}
```

I want to compare only time in HH:mm format. However it does not work because

```
'7:00' > '2:00'
```

returns false. Any ideas how to compare HH:mm?

comment.body:
I guess I don't quite understand what you mean by "ignoring the day". If you're comparing these two times

```js
var startTime = moment('06:00p', "HH:mm a");
var endTime = moment('03:30a', "HH:mm a");
```

somehow the system has to know that you mean 3:30 *tomorrow*. I mean, how could it ever work? Surely, you don't think that in the absence of day information that 3:30 AM is after 6:00 PM...The problem is that you have some extra context that Moment doesn't have, which is that the `endTime` is expected to be after the `startTime`; that's obvious from your variable names, but Moment doesn't and can't. You'll have to tell it.

So how about this:

```js
if (startTime.isAfter(endTime)){
  endTime.add(1, 'days');
}
```

